class FeeDecorator {
    constructor(component) {
        this.component = component;
    }

    calculatePrice(guestSize) {
        const price = this.component.calculatePrice(guestSize);
        const serviceFee = price * 0.1;
        const insuranceFee = price * 0.05;
        return price * guestSize + serviceFee + insuranceFee;
    }
}

export default FeeDecorator;
